import React from 'react'
import TextField from '@material-ui/core/TextField';

const findWechat = () => {
  return (
    <div>
      <form noValidate autoComplete="off">
        <TextField
            label="Wechat ID"
            id="outlined-size-normal"
            // defaultValue="Normal"
            variant="outlined"
        />
      </form>
    </div>
  )
}

export default findWechat
